import React, { Component } from 'react';
import {
  Container,
  Button,
  Row,
  Col,
  Card,
  CardImg,
  CardTitle,
  } from 'reactstrap';
import Adirasa from "../assets/Adirasa.png";
import "../App.css"

class ContentProduct extends Component {
  render() {
  return (
    <Container className="box">
        <img top width="100%" src={Adirasa} alt="Not found" top="true"/>
        <h1 className="display-3">Hello, Snack Lover's!</h1>
        <p>Bebas pilih snack favorite kamu</p>
        <p>Kamu tidak perlu repot karena kami akan mengirimkan langsung snack favorite kamu, fokuskan waktumu ke hal yang lebih penting</p>
        <p className="lead">
          <Button
           href="/signup"
           outline color="info"> Sign Up </Button>
        </p>

     <div className="box">
       <h1>Produk</h1>
       <Row>
         <Col xs={12} sm={12} md={12} lg={12}>
            <Card body className="borderproduct">
            <CardImg top width="50px" src={require(`../assets/peanut.png`)} alt="Card image cap" />
             <CardImg top width="100%" src={require(`../assets/traditional.png`)} alt="Card image cap" />
            <br/>
            <CardTitle>KACANG</CardTitle>
            <Button
              href="/productkacang"
              outline color="info"> Lihat Produk </Button>
            </Card>
          </Col>



       </Row>
      </div>
    </Container>
  );
 };
}

export default ContentProduct;
